import React from 'react';
import MyPageSideNav from './MyPageSideNav';

const MyPage = () => {
  return (
    <div>
      <MyPageSideNav userName="박범준" profileImage="img/my-profile.png" />
      <h2>Welcome to the Home Page</h2>
      <p>홈 페이지 내용</p>
    </div>
  );
};

export default MyPage;
